DPR:
Collect a unified dataset for fiscal years 2018 and 2019 that captures the detailed “NOTE 6 – OTHER LIABILITIES” disclosures, including line‑item amounts for:  
- Current other liabilities and non‑current other liabilities (and their total);  
- Other financial assets broken down by current and non‑current components (derivatives, listed equity securities, investments in associates, loans to related parties, and total other financial assets);  
- Lease liabilities split into current and non‑current portions (and total lease liabilities);  
- Cash, cash equivalents and marketable securities;  
- Total assets, total liabilities, and total non‑current liabilities.  

The dataset should enable users to compute year‑over‑year totals, averages across the two years, composition percentages (e.g., current liabilities as a share of total other liabilities, derivatives as a share of total other financial liabilities, lease liabilities as a share of total liabilities), and percentage changes between 2018 and 2019 for each line item.

Create a consolidated data product that captures National Storage’s acquisition activity and financial performance for FY2018‑FY2019, including:
- location‑level acquisition counts and Net Lettable Area (NLA) for each Australian and New Zealand centre, together with derived fields for regional totals, sums, differences and averages across locations;
- regional revenue figures for Australia and New Zealand for both FY2018 and FY2019, with year‑over‑year change amounts, percentage changes, averages across the two years, and flags for years where revenue falls below specified thresholds;
- non‑current asset values by region for FY2018 and FY2019, the share of each region’s assets in the total non‑current assets, and percentage changes year‑over‑year;
- identification of the four reportable service segments and any associated corporate cost allocations.

The dataset should enable analysts to assess the impact of the active growth (acquisition) strategy on geographic revenue growth, asset composition, and overall business performance.

Collect a unified dataset for Cogeco Communications that includes, for each fiscal year (e.g., 2017‑2019):  
1) the percentage of equity and voting shares held by Cogeco;  
2) management‑fee amounts before and after the methodology change;  
3) detailed share‑based compensation figures for stock options, ISUs, PSUs, and DSUs, allowing calculation of year‑over‑year changes, averages and trends;  
4) cost‑of‑investment balances at 1 January and 31 December, the amount of share options issued to subsidiary employees, and all additions, with both absolute and percentage changes year‑to‑year;  
5) a breakdown of employee‑related expenses (share‑based compensation, other expenses, total, restructuring costs, general & administrative expenses), supporting identification of the highest compensation year and computation of changes and percentages; and  
6) corporate metadata such as the country of incorporation and any announced employee relocation plans. The dataset should be structured to enable straightforward queries and calculations across these dimensions.

Collect a yearly dataset (2017‑2019) of the company’s stock‑based compensation that includes:  
1) the expense amounts allocated to cost of sales, selling‑general‑and‑administrative, research and development, total stock‑based compensation expense, and total expense net of tax;  
2) a detailed breakdown of each component type—employee stock options, assumed options, restricted stock units, restricted stock awards, and employee stock purchase plan—along with the associated tax‑benefit amounts;  
3) related compensation and benefits costs and professional/legal fees for each year;  
4) the fair‑value estimates for granted stock options (per‑share and total) and for restricted stock awards/units, plus a description of the intrinsic‑value calculation methodology;  
5) plan‑specific information such as the expiration year of the 2010 Directors Plan and the authorizations made under the 2015 Plan;  
6) calculated fields showing year‑over‑year absolute and percentage changes for total stock‑based compensation expense, net‑of‑tax expense, and each component;  
7) averages of the expense components over the three‑year period and the proportion of each component (e.g., employee stock options, employee stock purchase plan) relative to total stock‑based compensation expense.  

The resulting data product should enable analysts to query raw values, compare component trends across years, assess the impact of plan changes, and evaluate the relative contribution of each stock‑based compensation element to overall expense.

Collect a comprehensive, year‑by‑year dataset of the company’s income tax expense (or benefit) covering at least fiscal years 2017‑2019 that includes:  
1) Current and deferred tax amounts broken down by jurisdiction (U.S. federal, U.S. state, International/Non‑U.S.) and by type (current vs. deferred), together with total current, total deferred, and total income tax expense (benefit) for each year;  
2) Detailed adjustment line items that feed into the tax calculation—such as statutory‑rate computation, non‑deductible permanent differences, equity‑method investment income/loss, valuation‑allowance adjustments, effects of changes in enacted tax rates, current‑year credits, other tax credits, benefits from tax holidays, net impact of uncertain tax positions, and earnings of subsidiaries taxed at different rates;  
3) Pre‑calculated year‑over‑year absolute changes and percentage changes for the total tax expense as well as for each jurisdictional and adjustment component. This dataset should enable analysis of overall tax expense trends, identification of the primary drivers of changes across jurisdictions and adjustment categories, and assessment of the impact of specific tax provisions such as tax holidays and uncertain tax positions.

Collect a comprehensive dataset from the company’s Note 3 “Revenue from Contracts with Customers” that includes, for fiscal years 2018 and 2019, the beginning‑of‑period and end‑of‑period balances for all contract‑related line items (contract assets, commission costs and upfront payments capitalized, amortization of contract assets, prepaid expenses, contract costs, deferred costs, strategic investments, other assets, deferred compensation plan assets, investments in international licensees, equity investments/loans to ThinxNet GmbH and Smart Driver Club, deferred product cost, other current and non‑current assets, total deferred commissions, capitalized costs to obtain a contract, deferred costs to fulfill a contract, deferred setup costs, other deferred fulfillment costs).  

Provide calculated fields that show:  
- absolute and percentage year‑over‑year changes for each line item;  
- averages where appropriate (e.g., average contract costs, average capitalized costs to obtain a contract, average deferred setup costs);  
- totals for grouped categories (e.g., total deferred costs, total deferred commissions, sum of the top three asset balances);  
- counts of years in which specific thresholds are met (e.g., commission costs exceeding $4,500 k, other assets below $30 k).  

Include explanatory metadata describing the accounting rationale for capitalizing sales commissions and other incremental direct costs of obtaining customer contracts.  

The resulting data product should enable analysts to track trends, compare the composition of contract‑related assets and liabilities across the two years, assess the impact of capitalized costs and amortization, and perform threshold‑based queries.
